import React from 'react';
import '../../styles/Dashboard.css';


const CalorieSummary = () => {
  return (
    <div className="calorie-summary">
      <div className="calorie-box">
        <h3>938 Kcal</h3>
        <p>Calorie consumed</p>
      </div>
      <div className="calorie-box">
        <h3>213 Kcal</h3>
        <p>Calorie remaining</p>
      </div>
    </div>
  );
};

export default CalorieSummary;
